import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { registerUser } from '../services/userService'; // Import your user registration service

function RegisterPage() {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    // Add other necessary state variables
    const navigate = useNavigate(); // Initialize the useNavigate hook

    const handleRegister = async () => {
        try {
            const user = await registerUser({ email, password /* other data */ });
            console.log("User registered successfully:", user);
            navigate('/login'); // Redirect to the login page
        } catch (error) {
            console.error("Failed to register:", error);
            // Handle registration errors
        }
    };

    return (
        <div>
            <h1>Register</h1>
            {/* Form for registration details */}
            <input
                type="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
            />
            <input
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
            />
            {/* Include other input fields as necessary */}
            <button onClick={handleRegister}>Register</button>
        </div>
    );
}

export default RegisterPage;
